import React from "react";

export default function InputArea(props){
    return (<div className="form">
    <input
      value={props.text}
      onChange={(e) => props.OnChanged(e.target.value)}
      onKeyPress = {(k) =>{props.OnKeyPress(k.key)}
      }
    type="text"
    />
    <button onClick={
        () =>{
            props.OnClicked()
        }
    }>
      <span>Add</span>
    </button>
  </div>);

}
